import React from "react";

import "./NavBarItem.css";
import data from "../../data/navBar.json";

const NavBarItem = () => {
  return (
    <div>
      <h2>Item</h2>
      <ul>
        {data.map((item) => (
          <li>
            <i>{item.icon}</i>
            <span>{item.type}</span>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default NavBarItem;
